import React from 'react';
import './style.css'


const MediumArticle = ({ Img, Title, Description }) => {
    return (


        <article className="mediumArticleGame">

            <div>
                <img className="mediumArticle-thumb" src={Img} alt="Assassins creed news" />

            </div>

            <p className="mediumArticleTitle">{Title} </p>
            <p className="mediumArticleDescription">{Description} </p>

        </article>

    );
}

export default MediumArticle;
